import React,{useState, useCallback} from 'react'
import './Home.scss'

function Home() {
  const {isloading, setIsloading} = useState('true')
  isloading = useCallback(()=>{
    setTimeout(()=>{
      return isloading = 'false'
    },6000)
  },[setIsloading])

  return (
    <div>
      <h1>WELCOME TO EUNMI's PORTFOLIO</h1>
      {isloading ? 'lo...' : '...'}
    </div>
  )
}

export default Home
